import React from 'react'

const PresentNews = (props) => {

    const {news} = props

    return(
        <React.Fragment>
            {news.map((news,index)=>
            <h5 key={index}>{news.author}</h5>
            )}
        </React.Fragment>
    )
}

export default PresentNews;
